import React from "react";
import logo from "./logo.svg";
import "./App.css";

import { BrowserRouter, Routes, Route } from "react-router-dom";
import DealerList from "./components/DealerList";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="" element={<DealerList />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
